import { makeStyles } from '@material-ui/core/styles';

const BodyStyle = makeStyles((theme) => ({
    body: {
        backgroundColor: 'green',
        flexGrow: 1,
        height: `calc(100vh - ${theme.mixins.toolbar.height*2})`
    },
}));

export default BodyStyle;
